import React from "react";
import { Route, Switch } from "react-router-dom";
import {Provider} from '@react-spectrum/provider';
import {theme} from '@react-spectrum/theme-default';
import {Content} from '@react-spectrum/view';
import {Text} from '@react-spectrum/text';
import {Tabs, Item} from '@react-spectrum/tabs';
import {Flex} from '@adobe/react-spectrum'
import {Grid, View} from '@adobe/react-spectrum'
import {Link} from '@adobe/react-spectrum'
import headshot from './assets/headshot.jpg';
import AboutMe from './AboutMe';
import Code from './Code'; 
import Design from './Design';
import ThreeD from './ThreeD';
import githubIcon from './assets/icons/svg/032-github.svg';
import instagramIcon from './assets/icons/svg/044-instagram.svg'; 
import linkedinIcon from './assets/icons/svg/052-linkedin.svg'; 
import {Menu, MenuTrigger, ActionButton} from '@adobe/react-spectrum'



export default function App() {
  var currentPage = <AboutMe></AboutMe>
  function displayPage(key) {
    if (key==="3D") {
      <ThreeD></ThreeD>
    } else if (key==="design") {

    } else if (key==="more") {

    }
  }
  return (

    <Provider theme={theme}>
    <div>
      <Grid
        // areas={['sidebar content', 'footer  footer']}
        areas={['header  header', 'sidebar  content', 'footer  footer']}

        columns={['1fr','3fr']}
        rows={['size-1000', 'auto', 'size-1000']}

        height="size-7000"
        gap="size-50">
        {/* <View backgroundColor="" gridArea="header">

        </View>  */}
        <View backgroundColor="" gridArea="sidebar">
          <div class="side-panel">
            <h1>Jess Peng</h1>
            <h6>Code • Design • 3D</h6>
            <img id="headshot" src={headshot} alt="Headshot"></img><br></br>
            <p>Hi, welcome to my site!<br></br></p>
            <a href="https://www.instagram.com/peng.and.ink/?hl=en" target="_blank"><img class="social-icon" src={githubIcon}></img></a>
            <a href="https://www.instagram.com/peng.and.ink/?hl=en" target="_blank"><img class="social-icon" src={instagramIcon}></img></a>
            <a href="https://www.linkedin.com/in/jess-peng/" target="_blank"><img class="social-icon" src={linkedinIcon}></img></a>
            <p>If you're interested in collaborating or have questions, feel free to reach me at jesspeng@adobe.com:)</p>
          </div>
        </View> 
        <View backgroundColor="" gridArea="content">
          <Tabs aria-label="Navigation Bar">
            <Item title="About Me" key="AbMe">
              <Content marginTop="size-250" marginStart="size-125">
                <AboutMe></AboutMe>
              </Content>
            </Item>
            <Item title="Code" key="Co">
              <Content marginTop="size-250" marginStart="size-125">
                <Code></Code>
              </Content>
            </Item>
            <Item title="Art" key="Art">
              <Item title="Design" key="Des">
                <Content marginTop="size-250" marginStart="size-125">
                  <Design></Design>
                </Content>
              </Item>
            </Item>

            <Item title="3D" key="3D">
              <Content marginTop="size-250" marginStart="size-125">
                <ThreeD></ThreeD>
              </Content>
            </Item>
            <Item title="Resume" key="Res">
              <Content marginTop="size-250" marginStart="size-125">
              </Content>
            </Item>
          </Tabs>
        </View> 
        <View backgroundColor="magenta-600" gridArea="footer">
        <div style={{color: 'white', fontSize: '5px'}}>Icons made by <a href="https://www.flaticon.com/authors/pixel-perfect" title="Pixel perfect">Pixel perfect</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>
        </View> 
      </Grid>
    </div>
    </Provider>
  );
}
